const generarPDF = async (htmlContent, name) => {
    const footerImage = 'data:image/webp;base64,';

    const browser = await puppeteer.launch();
    const page = await browser.newPage();
    await page.setContent(htmlContent, { waitUntil: 'networkidle2' });
    const pdfBuffer = await page.pdf({ 
        format: 'A4',
        printBackground: true,
        width: '1000px',
        height: '2000px',
        landscape: false,
        path: `${name}.pdf`,
        displayHeaderFooter: true,
        footerTemplate: `
            <div style="display: flex; justify-content: center; position: absolute; bottom: 0">
                <img src="${footerImage}" alt="image footer" width="900" />
            </div>`,
    });
    await browser.close();
    return pdfBuffer;
}